"use strict";

import { assert } from 'chai';
import test_utils from '../../test_utils';
import publicRoutes from '../../../src/server/routing/publicRoutes';
import request from '../../../src/request';
import Client from '../../../src/client/client';
import auth from '../../../src/server/auth';
import config from '../../../config';
import linkedIn from '../../../src/server/linkedIn';
import nock from 'nock';
import Qfs from 'q-io/fs';
import path from 'path';

let baseUrl = 'http://localhost:' + config.app_port;

describe('privateRoutes', () => {
  let client;

  before(async () => {
    test_utils.startServer();
    client = await new Client();
    await auth.createUser('testUser', 'testPass');
  });
  after(async () => {
    nock.enableNetConnect();
    test_utils.stopServer();
    await auth.deleteUser('testUser');
  });

  describe('/admin/update', () => {
    let id = 'abc';
    let profilePicLocation = path.join(process.cwd(), `/public/profilePics/${id}.jpg`);

    beforeEach(async () => {
      await Qfs.remove(profilePicLocation);

      nock('https://api.linkedin.com')
        .get('/v1/people/~:(id,first-name,last-name,location,industry,headline,summary,specialties,positions,skills,educations,public-profile-url,picture-urls::(original))')
        .reply(200, {
          id: id,
          firstName: 'Foo',
          lastName: 'Bar',
          location: { name: 'Baz' },
          industry: 'Qux',
          headline: 'Quux',
          summary:  'Corge',
          skills: { _total: 0, values: [] },
          positions: { _total: 1, values: [{
            id: 670056482,
            company: { 'name': 'Garply' },
            isCurrent: true,
            startDate: { month: 5, year :2015 },
            summary: 'Waldo',
            title: 'Fred'
          }]},
          educations: { _total: 0, values: [] },
          publicProfileUrl: 'https://www.linkedin.com/in/plugh',
          imagePath: '/public/profilePics/QJbIHWHRUv.jpg',
          pictureUrls: {
            _total: 1,
            values: [ 'https://api.linkedin.com/images/1' ],
          }
        });

      nock('https://api.linkedin.com')
        .get('/images/1')
        .reply(200, "",
          { date: 'Mon, 06 Jul 2015 16:40:48 GMT',
            'content-type': 'image/jpeg',
            'content-length': '20272',
            connection: 'close',
            server: 'Apache-Coyote/1.1',
            'cache-control': 'max-age=604800',
            'x-li-fabric': 'prod-ltx1',
            'x-li-pop': 'prod-tln1',
            'x-li-uuid': 'Z9tLkedl7hNgP4s18yoAAA==',
            age: '3472',
            'last-modified': 'Thu, 30 Oct 2014 12:27:51 GMT',
            expires: 'Mon, 13 Jul 2015 15:42:56 GMT',
            'x-cdn': 'LLNW',
            'access-control-allow-origin': 'https://www.linkedin.com',
            'timing-allow-origin': '*'
          });

      nock.enableNetConnect('localhost');
    });

    afterEach(async () => {
      await linkedIn.deleteProfile(id);
    });

    it('saves data from linkedIn', async () => {
      await client.login('testUser', 'testPass');
      await request.get('/admin/update');
      let imageExists = await Qfs.exists(profilePicLocation);
      assert(imageExists);
      let profile = await linkedIn.getProfile();
      assert.equal(profile.firstName, 'Foo');
      assert.equal(profile.lastName, 'Bar');
    });
  });
});
